function Cards() {
    const [data ,Setdata] = useState([
        {
            name:"Avengers" ,
            year:"2020",
            Rating:5,
            Img :"https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7"

        }
    ]);
  return (
    <div className='flex flex-wrap justify-between p-3 mt-2'>
       { <div className="card shadow-lg font-medium p-2 hover:-translate-y-2 cursor-pointer mt-3">
            <img className="h-72" src='https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7'/>
            <h1><span className='text-gray-500'>Name : </span>Ping Pong </h1>
            <h1><span className='text-gray-500'>Rating :</span> 5</h1>
            <h1><span className='text-gray-500'>Year : </span>2023</h1>
        </div>
    }
    </div>
  )
}

export default Cards
